function Winner(props) {
    return (
        <div className={"winner-tr"}>
            <td>{props.winner.address}</td>
            <td>{props.winner.fee}</td>
            <td>{props.winner.entrance_date}</td>
            <td>{props.winner.won}</td>
            <td>{props.winner.date}</td>
        </div>
    );
}

export default Winner;
